<script setup>
import { onBeforeMount , computed , ref } from 'vue';
import { RouterLink } from 'vue-router';
import store from '../store';
import router from '../router';
import serverURL from '../router/serverAddress';

const userData = ref(null)
const username = ref(null)
const phone = ref(null)
const hasImage = ref(false)
const hasData = ref(true)
const currentUser = computed(() =>{
  return store.state.auth.auth.user;
})

onBeforeMount(()=>{
  if (!currentUser) {
    router.push('/login');
  }
  else{
    async function getData() {
      const res = await fetch(serverURL + "/api/users/" + localStorage.getItem('userId'));
      userData.value = await res.json();
      if (!userData.value.image) {
        userData.value.image = null;
      }
      username.value = userData.value.username
      phone.value = userData.value.phone
      hasData.value = false
    }
    getData()
  }
})


const logout = () =>{
  store.dispatch('auth/logout')
  router.push('/login');
}

</script>
